import React from 'react';
import ProjData from './ProjData';

const ProjCard = (prop) =>{
    return (
        <>
                <div class="carousel-item active">
                        <div class="row gy-5">
                                <div class="col-md-4 mb-3">
                                    <div class="card" style={{width: '18rem'}}>
                                        <img class="img-fluid" alt="100%x280" src={prop.imgsrc}/>
                                        <div class="card-body">
                                            <h4 class="card-title">{prop.title}</h4>
                                            <p class="card-text">{prop.text}</p>

                          
                                        </div>
                                        </div>
                        </div>
                                    
                                    </div>
                </div>
    
                               
        </>
    );
};
export default ProjCard;
